import { useState, useMemo } from "react";
import { ThemeProvider, CssBaseline, Box, useMediaQuery } from "@mui/material";
import { createTheme } from "@mui/material/styles";
import Navbar from "./components/dashboard/Navbar";
import SearchBar from "./components/search/SearchBar";
import CurrentWeatherCard from "./components/current/CurrentWeatherCard";
import WeatherDetails from "./components/current/WeatherDetails";
import WeatherIcon from "./components/current/WeatherIcon";
import MapContainer from "./components/map/MapContainer";
import useFetch from "./components/hooks/useFetch";

function App() {
  // Detect system theme preference
  const prefersDarkMode = useMediaQuery('(prefers-color-scheme: dark)');
  const [darkMode, setDarkMode] = useState(prefersDarkMode);

  // Memoized theme for performance
  const theme = useMemo(
    () =>
      createTheme({
        palette: {
          mode: darkMode ? "dark" : "light",
        },
      }),
    [darkMode]
  );

  const [location, setLocation] = useState("");
  const [data, fetchData, loading, error] = useFetch();

  const handleSubmit = (e) => {
    e.preventDefault();
    fetchData(location);
  };

  return (
    <ThemeProvider theme={theme}>
      <CssBaseline />
      <Navbar
        darkMode={darkMode}
        onToggleTheme={() => setDarkMode((prev) => !prev)}
      />
      <main>
        <Box sx={{ display: "flex", justifyContent: "center", my: 3 }}>
          <SearchBar
            value={location}
            onChange={(e) => setLocation(e.target.value)}
            onSubmit={handleSubmit}
          />
        </Box>

        {loading && <div>Loading...</div>}
        {error && <div style={{ color: "red" }}>{error}</div>}

        {/* Responsive layout for weather info and map */}
        {data && data.main && (
          <Box
            sx={{
              display: "flex",
              flexDirection: { xs: "column", md: "row" },
              width: "100vw",
              minHeight: "100vh",
              boxSizing: "border-box",
            }}
          >
            {/* Weather Info (left/top) */}
            <Box
              sx={{
                flex: 1,
                display: "flex",
                flexDirection: "column",
                alignItems: "center",
                width: "100%",
                gap: 2,
              }}
            >
              <CurrentWeatherCard data={data} />
              <WeatherDetails data={data} />
              <WeatherIcon iconCode={data.weather && data.weather[0]?.icon} alt={data.weather && data.weather[0]?.description} />
            </Box>
            {/* Map (right/bottom) */}
            <Box
              sx={{
                flex: 2,
                width: "100%",
                minHeight: { xs: 250, md: "100vh" },
                display: "flex",
                alignItems: "center",
                justifyContent: "center",
              }}
            >
              <MapContainer
                coord={data.coord}
                city={data.name}
              />
            </Box>
          </Box>
        )}
      </main>
    </ThemeProvider>
  );
}

export default App;
